uint16_t* bitmapPointer(unsigned int idx) {
	switch (idx) {
		case ICON_CANCEL:    return (uint16_t*) _ICON_CANCEL;
		case ICON_ACCEPT:    return (uint16_t*) _ICON_ACCEPT;
		case ICON_THERMO:    return (uint16_t*) _ICON_THERMO;
		case ICON_IMU:       return (uint16_t*) _ICON_IMU;
		case ICON_GPS:       return (uint16_t*) _ICON_GPS;
		case ICON_LIGHT:     return (uint16_t*) _ICON_LIGHT;
		case ICON_UVI:       return (uint16_t*) _ICON_UVI;
		case ICON_SOUND:     return (uint16_t*) _ICON_SOUND;
		case ICON_RH:        return (uint16_t*) _ICON_RH;
		case ICON_MIC:       return (uint16_t*) _ICON_MIC;
		case ICON_MAGNET:    return (uint16_t*) _ICON_MAGNET;
		case ICON_BATTERY:   return (uint16_t*) _ICON_BATTERY;
	}
	return nullptr;
}
